import ForceGraph2D from "react-force-graph-2d";

const data = {
  nodes: [
    { id: "A" },
    { id: "B" },
    { id: "C" },
  ],
  links: [
    { source: "A", target: "B" },
    { source: "A", target: "C" },
  ],
};

export default function Dashboard() {
  return (
    <>
      <h1 style={{ color: "white" }}>Dashboard</h1>
      <ForceGraph2D
        graphData={data}
        nodeAutoColorBy="id"
        linkDirectionalParticles={2}
        linkDirectionalParticleSpeed={0.005}
        backgroundColor="#444654"
        nodeLabel="id"
        nodeRelSize={8}
      />
    </>
  );
}
